      title: "夏目漱石",
      artist: "🎉 橘子海",
      img_src: "../images/log.jpeg",
      src: "../music/夏目漱石.mp3",
    },
  ]);
  return <div className="App">创建一个简单的音乐播放器</div>;
}

export default App;
